import React from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataCard = ({ data }) => {
	const dataArr = Object.entries(data);

	const nyc = dataArr[0][1][0];
	const gaurdian = dataArr[0][1][1];
	let gaurdianFiltered = [];

	if (gaurdian !== undefined) {
		gaurdianFiltered = gaurdian.filter(item => item !== undefined);
	}

	const nycArr = [];
	const gaurdianArr = [];

	gaurdianFiltered.map(item => {
		gaurdianArr.push(item);
	});

	if (typeof nyc !== 'undefined') {
		data.data[0].map(item => {
			nycArr.push(item);
		});
	}

	return (
		<ol>
			{nycArr.map(item => (
				<li key={item.url}>{item.url.value.value}</li>
			))}
			{gaurdianArr.map(item => (
				<li>{item.webTitle}</li>
			))}
		</ol>
	);
};

DataCard.propTypes = {
	DataCard: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps)(DataCard);
